import React, { Component } from 'react';
import { FaNodeJs, FaLeaf, FaRegImages } from "react-icons/fa";
import SectionHeader from './../component/section-header';
import './../css/feature.css';

const FeatureList = [
    {
        icon: <FaNodeJs />,
        title: 'NodeJs',
        description: 'Base'
    },
    {
        icon: <FaLeaf />,
        title: 'MongoDB',
        description: 'Lorem ipsum dolor sit amet, conseda adipiscing elit. Aenean commodo ligula eget dolorAenean massa. Cum sociind'
    },
]

// header section content
const Prerequisite = <h3 className="mb--25">Pre-requisite<br /></h3>;
const subtitle = <h6>All items that you must already installed in your machine.</h6>;
const alignment = 'section-header text-center pb--60';

class Feature extends Component {
    render() {
        return (
            <section id="feature" className="feature-section pt--60 pb--60 pt_lg--100 pb_lg--100">
                <div className="container">
                    <SectionHeader
                        title={Prerequisite}
                        subtitle={subtitle}
                        alignment={alignment}
                    />
                </div>
                <div className="container">
                    <div className="d-flex row justify-content-center justify-content-lg-center">
                        {FeatureList.map((val, i) => (
                            <div className="col-md-6 col-lg-4 mb--30 mb-lg-0" key={i}>
                                <div className="feature-item text-left">
                                    <div className="icon-box">
                                        <div className="icon">
                                            {val.icon}
                                        </div>
                                        <img
                                            src="assets/images/feature/feature-dot-shape.png"
                                            alt="dot shape"
                                        />
                                    </div>
                                    <h5>{val.title}</h5>
                                    <p>{val.description}</p>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            </section>
        )
    }
}

export default Feature;
